import React,{useState} from "react"

function Login(){
const[text,setText]=useState(
    {login:"",
    password:"",
    phone:"",
    name:"",
    surname:""}
    )

console.log(text)
    return( 
    <div className="input_div">
   

<div class="input-group nam_sur">
  <span class="input-group-text">First and last name</span>
  <input type="text" aria-label="First name" class="form-control" placeholder="введите ваше имя" value={text.name} onChange={e=>setText(p=>{
        return {...p,name:e.target.value}
    })}  ></input>
  <input type="text" aria-label="Last name" class="form-control" placeholder="введите вашу фамилию" value={text.surname} onChange={e=>setText(p=>{
        return {...p,surname:e.target.value}
    })}  ></input>
</div>
<div>

<form>
  <div class="mb-3">
    <label for="exampleInputEmail1" class="form-label">Номер телефона</label>
    <input type="email" class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp"  placeholder="введите ваш номер телефона" value={text.phone} onChange={e=>setText(p=>{
        return {...p,phone:e.target.value}
    })}  ></input>
    <div id="emailHelp" class="form-text">We'll never share your email with anyone else.</div>
  </div>
  <div class="mb-3">
    <label for="exampleInputPassword1" class="form-label">Login</label>
    <input type="password" class="form-control" id="exampleInputPassword1" value={text.login} onChange={e=>setText(p=>{
        return {...p,login:e.target.value}
    })} ></input>
  </div>
  <div class="mb-3">
    <label for="exampleInputPassword1" class="form-label" value={text.password} onChange={e=>setText(p=>{
        return {...p,password:e.target.value}
    })}  >Password</label>
    <input type="password" class="form-control" id="exampleInputPassword1"></input>
  </div>


  <div class="mb-3 form-check">
    <input type="checkbox" class="form-check-input" id="exampleCheck1"></input>
    <label class="form-check-label" for="exampleCheck1">Согласен с правилами сайта</label>
  </div>
</form>


</div>





<button type="button" class="btn btn-success">Зарегистрироваться</button>

    </div>
    )
}
export default Login
